import React from 'react';
import Button from '../../../general/button/button'


class BusDetails extends React.Component{
  constructor(props){
    super(props);
  }
  render(){
    return(
      <div>
           <form action="/action_page.php">
             <div className="col-12 collapse show multi-collapse" id="multiCollapseExample1">
              {this.props.data.map((items)=>{
              return(
                <div className={items.classN}>
                  <label for={items.for} class={items.labelC}>{items.value}</label>
                  <input className={items.inputC} type={items.type} placeholder={items.placeholder} required/>
                </div>
              )})}
                <Button type="btn" name="Submit"/>
                </div>
          </form>
      </div>

      )
  }
}
export default BusDetails
